import * as api from '../api';
import {act} from "@testing-library/react";


const getPosts = () => async (dispatch) => {

    try{
        const {data} = await api.fetchPosts();
    }catch (e) {

    }
    const action = { type: 'FETCH_ALL', payload: []}

    dispatch(action);
}
